def Affine_Dec(ptext, key):
    plen = len(ptext)
    ctext = ""
    for i in range (0,plen,2):
        letter=""
        letter += ptext[i]
        letter += ptext[i+1]
        
        if letter in new_dict:
            poz = new_dict[letter]
            poz = (key.gamma*poz+key.theta)%961
            #print poz
            ctext += inv_dic[poz]
        
    return ctext


